    data: |
      SELECT col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 45 * - 97 NOT BETWEEN - 12 AND ( - CAST ( - 7 AS INTEGER ) * col2 );
  - name: tab1

outputs:
  - name: q13435.out
    data: |
